text:
Ghula hua hai tera ishq is kadar mujhme, ho chuka hu Saturate ;
kisi aur ko ab chahu bhi toh 
that will remain as a Precipitate.

Ruthe khabon ko mana lenge, kati patango ko thamengey;
 o o hai zajba o o hai zajba
 suljha lenge uljhe rishto'n ka manja

gali ke us taraf se tujhko aata dekh ke;
kitni baar socha keh du tujhe dil ki baat
ki mai tujhse pyaar karta hu;... http://t.co/GhMGE7J
